import Header from 'components/header/header';
import { DrawerProvider } from '../../contexts/drawer/drawer.provider';
import React from 'react';

const Blogs = () => {
    return (
        <DrawerProvider>
            <Header></Header>
            </DrawerProvider>
    )
};

export default Blogs;
